css:
.nuclide-ui-listview {
  overflow-y: auto;
}
.nuclide-ui-listview-highlight-odd > .nuclide-ui-listview-item:nth-child(odd) {
  background-color: #31363f;
}
.nuclide-ui-listview-item {
  padding: 3px 6px;
}
.nuclide-ui-listview-selectable > .nuclide-ui-listview-item {
  cursor: pointer;
}
.nuclide-ui-listview-selectable > .nuclide-ui-listview-item:hover {
  background-color: #0f82e6;
  color: #d7dae0;
}
